      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n \n  \u003Cdiv style=\"width: 90%;\"\u003E\n      \n    \u003Ch2\u003EIstruzioni\u003C\u002Fh2\u003E\n    \u003Cp class=\"text-left\"\u003EQuesto esperimento riguarda il modo in cui le persone elaborano le parole. Le verrà chiesto di vedere delle parole e valutarle. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003ELe parole verranno presentate al centro dello schermo. Dovrebbe chiedersi se la parola sullo schermo è una parola vera o una parola falsa.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003ESe riconosce la parola sullo schermo, come \u003Cb\u003EFREDDO\u003C\u002Fb\u003E, prema il tasto \u003Ckbd\u003E${ window.word_key }\u003C\u002Fkbd\u003E per “parola reale”. Se la parola è inventata senza senso, come \u003Cb\u003ECRANDO\u003C\u002Fb\u003E, prema il tasto \u003Ckbd\u003E${ window.nonword_key }\u003C\u002Fkbd\u003E per “parola falsa”. Durante la pratica, le forniremo un feedback.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E Le chiediamo di rispondere il più rapidamente possibile rimanendo accurata\u002Fo. Ha tre secondi per rispondere a ogni parola.\u003C\u002Fp\u003E\n  \n  \u003C\u002Fdiv\u003E\n\n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n  Si prega di premere la \u003Ckbd\u003EBARRA SPAZIATRICE\u003C\u002Fkbd\u003E per fare alcune prove per esercitarsi. \n\u003C\u002Ffooter\u003E",
